import ThreeGlobe from 'three-globe';
import * as THREE from 'three';


export default function Klode() {
    const myGlobe = new ThreeGlobe()
    .globeImageUrl("https://www.solarsystemscope.com/textures/")

    const myScene = new THREE.Scene();
    myScene.add(myGlobe);
}
